        <style>
            
                rect[data-level='0'] { fill: #eee }
            
                rect[data-level='1'] { fill: #d6e685 }
            
                rect[data-level='2'] { fill: #8cc665 }
            
                rect[data-level='3'] { fill: #44a340 }
            
                rect[data-level='4'] { fill: #1e6823 }
            
            rect[data-level='-1'] { display: none; }
            
                .calendar {
                    width: 1361.08px;
                }
                svg.js-calendar-graph-svg {
                    width: 100% !important;
                }
                body {
                    overflow-x: auto;
                    padding: 10px;
                }
                .calendar-graph {
                    width: auto;
                    padding: 8px;
                }
            
        </style>
    </head>
